@dataclass
class SpanObject:
    byte_end: int
    byte_start: int
    column_end: int
    column_start: int
    line_end: int
    line_start: int
    file_name: str

    @classmethod
    def FromJsonObj(cls, json_obj):
        return cls(byte_end=json_obj['byte_end'], byte_start=json_obj['byte_start'],
                   column_end=json_obj['column_end'], column_start=json_obj['column_start'],
                   line_end=json_obj['line_end'], line_start=json_obj['line_start'],
                   file_name=json_obj['file_name'])

    def as_dict(self):
        return {
            'byte_end': self.byte_end,
            'byte_start': self.byte_start,
            'column_end': self.column_end,
            'column_start': self.column_start,
            'line_end': self.line_end,
            'line_start': self.line_start,
            'file_name': self.file_name
        }

@dataclass
class SrcExtra:
    filename: str
    manifest: str

    def as_dict(self):
        return {'filename': self.filename, 'manifest': self.manifest}


ScoutCodeCategories = {}


@dataclass
class ScoutVulnerability:
    message: str
    code: str
    level: str
    spans: List[SpanObject]
    src_path: str
    src_line: int
    src_extra: SrcExtra

    @property
    def category(self):
        return ScoutCodeCategories.get(self.code, 'unknown')

    def asFinding(self)->Finding:
        return Finding(
            name=self.code,
            desc=self.message,
            category=self.category,
            level=self.level,
            filename=self.src_path,
            lineno=self.src_line,
            scanner=Scanner('scout'),
            jsonextra=json.dumps({
                'spans': [s.as_dict() for s in self.spans],
                'extra': self.src_extra.as_dict()
            })
        )

    @classmethod
    def FromJsonObj(cls, json_obj):
        if ((not json_obj['reason'] == 'compiler-message') or
                (json_obj['message'] is None) or
                (json_obj['message']['code'] is None)):
            return None  # raise Exception("probably not a scout vuln.")
        return cls(
            message=json_obj['message']['message'],
            code=json_obj['message']['code']['code'],
            level=json_obj['message']['level'],
            spans=[SpanObject.FromJsonObj(o) for o in json_obj['message']['spans']],
            src_path=json_obj['target']['src_path'],
            src_line=json_obj['message']['spans'][0]['line_start'],
            src_extra=SrcExtra(
                filename=json_obj['message']['spans'][0]['file_name'],
                manifest=json_obj['manifest_path']))


class TestScoutVulnFromJson(unittest.TestCase):
    def test_basic1(self):
        found = parseAll(DATA)
        self.assertEqual(
            ScoutVulnerability(message='Use the latest version of Soroban', code='soroban_version', level='warning',
                               spans=[SpanObject(byte_end=0, byte_start=0, column_end=1, column_start=1, line_end=1,
                                                 line_start=1,
                                                 file_name='avoid-core-mem-forget-1/vulnerable-example/src/lib.rs')],
                               src_path='/scoutme/srcs/test-cases/avoid-core-mem-forget/avoid-core-mem-forget-1/vulnerable-example/src/lib.rs',
                               src_line=1,
                               src_extra=SrcExtra(filename='avoid-core-mem-forget-1/vulnerable-example/src/lib.rs',
                                                  manifest='/scoutme/srcs/test-cases/avoid-core-mem-forget/avoid-core-mem-forget-1/vulnerable-example/Cargo.toml')),
            found[1]
        )
        self.assertEqual(
            ScoutVulnerability(message='Use the `let _ = ...` pattern or `.drop()` method to forget the value',
                               code='avoid_core_mem_forget', level='warning', spans=[
                    SpanObject(byte_end=433, byte_start=413, column_end=29, column_start=9, line_end=23, line_start=23,
                               file_name='avoid-core-mem-forget-1/vulnerable-example/src/lib.rs')],
                               src_path='/scoutme/srcs/test-cases/avoid-core-mem-forget/avoid-core-mem-forget-1/vulnerable-example/src/lib.rs',
                               src_line=23,
                               src_extra=SrcExtra(filename='avoid-core-mem-forget-1/vulnerable-example/src/lib.rs',
                                                  manifest='/scoutme/srcs/test-cases/avoid-core-mem-forget/avoid-core-mem-forget-1/vulnerable-example/Cargo.toml')),
            found[0])
        self.assertEqual(len(found), 2)


def parseAll(DATA):
    st = defaultdict(int)
    found = []
    for line in DATA.splitlines():
        line = line.strip()
        jline = json.loads(line)
        st[jline['reason']] += 1
        if jline['reason'] == 'compiler-message':
            # print(json.dumps(jline, indent=4))
            sv = ScoutVulnerability.FromJsonObj(jline)
            # print(repr(sv))
            found.append(sv)
        else:
            pass  # print(repr(jline))
    print(repr(st))
    return found


